import data from './../Data/Superheroes'
import React from 'react';


const SwitchMarvel = () => {


    const handleClick = () => {
        alert('1');
    };
    return (
        <div className='ctalog' onClick={handleClick}>
            {data.marvel.map((item, index) =>
                <div className='catalog1'>
                    <img src={item.image}></img>
                    <p>{item.name}</p>
                </div>
            )}
        </div>
    )
};


export default SwitchMarvel;
